65:fP,W4566:"Per iscriverti e partecipare a un'arena è necessario appartenere a un clan composto da almeno 7 membri, di cui 5 titolari e 2 riserve.\u003Cbr\u003EÈ possibile iscriversi alle arene il cui stato di registrazione è \"aperto\". Seleziona i giocatori partecipanti del tuo clan e paga la quota d'iscrizione stabilita dall'host.\u003Cbr\u003ESe l'host approva la richiesta, la tua squadra verrà regolarmente registrata.\u003Cbr\u003EUna volta completata l'iscrizione non potrai più ritirarti. Il capoclan si assume la responsabilità di eventuali svantaggi, come l'abbandono dovuto alla mancata partecipazione, quindi consultati con i membri del tuo clan prima di iniziare.\u003Cbr\u003ENexon non è coinvolta in questioni relative alla quota d'iscrizione. Tutte le responsabilità ricadono sull'organizzatore e sui partecipanti. Fai particolare attenzione quando è presente una quota d'iscrizione.\u003Cbr\u003E\u003Cbr\u003ENota: i membri del clan attualmente sospesi o che ne fanno parte da meno di 24 ore non possono partecipare all'arena.",W4567:"Il sistema aggiorna automaticamente l'elenco delle partite nell'arena e registra i loro risultati,con premi in denaro stabiliti in base alle impostazioni dell'host.Nexon non è coinvolta nelle questioni relative ai premi in denaro, per cui la responsabilità ricade sull'host e sui partecipanti.\u003Cbr\u003E",W4568:"Richiesta di partecipazione",W4569:"Approva",W4570:"Registrati per partecipare                                                                                                                                                          ",W4571:"Se 2 o più squadre si sono registrate per partecipare all'arena,\u003Cbr\u003Eil suo annullamento comporterà una riduzione della tua valutazione di fiducia.",W4572:"Il servizio è terminato",W4573:"Tutti i servizi di VEILED EXPERTS sono terminati giovedì 14 dicembre 2023. \u003Cbr\u003EVorremmo esprimere la nostra sincera gratitudine a tutti coloro che hanno amato VEILED EXPERTS.",W45